import React, { Fragment, useEffect, useState } from 'react';
import Breadcrumb from "../../common/breadcrumb";
import MaterialTable from "material-table";
import CancelIcon from '@material-ui/icons/Cancel';
import EditIcon from '@material-ui/icons/Edit';
import imagen1 from "../../../assets/images/imagenes";
import imagen2 from "/imagenes/bolsa.jpg";
import imagen3 from "/imagenes/camisetas.jpg";
import imagen4 from "/imagenes/camisetas1.jpg";
import imagen5 from "/imagenes/caramañola.jpg";
import imagen6 from "/imagenes/caramañola1.jpg";
import imagen7 from "/imagenes/caramañola2.jpg";
import imagen8 from "/imagenes/casco1.jpg";
import imagen9 from "/imagenes/sillin.jpg";
import imagen10 from "/imagenes/sillin1.jpg";
import imagen11 from "/imagenes/sillin3.jpg";
import imagen12 from "/imagenes/zapatillas.jpg";
import imagen13 from "/imagenes/zapatillas1.jpg";
import imagen14 from "/imagenes/zapatillas2.jpg";
import imagen15 from "/imagenes/zapatillas3.jpg";
import imagen16 from "/imagenes/casco.jpg";

function ListarProductos(props) {
    const [listProductos, setListProductos] = useState([]);

    const columnas = [
        { 
          title: 'Avatar',
          field: 'imageUrl',
          render: rowData => <img src={imagen1} style={{ width: 40, borderRadius: '50%' }} /> },
        { 
          title: 'Name', 
          field: 'name' 
        },
        { title: 'Surname',
          field: 'surname' 
        },
        { title: 'Birth Year', 
          field: 'birthYear', 
          type: 'numeric' 
        },
        {
          title: 'Birth Place',
          field: 'birthCity',
          lookup: { 34: 'İstanbul', 63: 'Şanlıurfa' },
        }
    ]


    return (
        <Fragment>
            <Breadcrumb title="Listar Productos" parent="Physical" />
            <div id="basicScenario" className="product-physical">
                <MaterialTable
                    title="Render Image Preview"
                    columns={columnas}
                    data={[
                        { name: 'Mehmet', surname: 'Baran', birthYear: 1987, birthCity: 63, imageUrl: 'https://avatars0.githubusercontent.com/u/7895451?s=460&v=4' },
                        { name: 'Zerya Betül', surname: 'Baran', birthYear: 2017, birthCity: 34, imageUrl: 'https://avatars0.githubusercontent.com/u/7895451?s=460&v=4' },
                    ]}
                />
            </div>

        </Fragment>
    );
}

export default ListarProductos;
